import React, { Component } from 'react';
import LineChart from 'react-linechart';
import Axios from 'axios';
import { Line } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";

//
function ChartLine() {

    const CheckedRideName = () => {

        Axios.get(`http://localhost:3001/sendRideNameGraph`).then(res => {
            console.log(res.data)
        }).catch(err => console.log(err));
    }

    const CheckedStat = () => {

        Axios.get(`http://localhost:3001/sendStatsGraph`).then(res => {
            console.log(res.data)
        }).catch(err => console.log(err));
    }



    window.addEventListener('load', CheckedRideName())
    window.addEventListener('load', CheckedStat())

    state = {
        dataLine: {
          labels: ["January", "February", "March", "April", "May", "June", "July"],
          datasets: [
            {
              label: "My First dataset",
              fill: true,
              lineTension: 0.3,
              backgroundColor: "rgba(225, 204,230, .3)",
              borderColor: "rgb(205, 130, 158)",
              borderCapStyle: "butt",
              borderDash: [],
              borderDashOffset: 0.0,
              borderJoinStyle: "miter",
              pointBorderColor: "rgb(205, 130,1 58)",
              pointBackgroundColor: "rgb(255, 255, 255)",
              pointBorderWidth: 10,
              pointHoverRadius: 5,
              pointHoverBackgroundColor: "rgb(0, 0, 0)",
              pointHoverBorderColor: "rgba(220, 220, 220,1)",
              pointHoverBorderWidth: 2,
              pointRadius: 1,
              pointHitRadius: 10,
              data: [65, 59, 80, 81, 56, 55, 40]
            },
            {
              label: "My Second dataset",
              fill: true,
              lineTension: 0.3,
              backgroundColor: "rgba(184, 185, 210, .3)",
              borderColor: "rgb(35, 26, 136)",
              borderCapStyle: "butt",
              borderDash: [],
              borderDashOffset: 0.0,
              borderJoinStyle: "miter",
              pointBorderColor: "rgb(35, 26, 136)",
              pointBackgroundColor: "rgb(255, 255, 255)",
              pointBorderWidth: 10,
              pointHoverRadius: 5,
              pointHoverBackgroundColor: "rgb(0, 0, 0)",
              pointHoverBorderColor: "rgba(220, 220, 220, 1)",
              pointHoverBorderWidth: 2,
              pointRadius: 1,
              pointHitRadius: 10,
              data: [28, 48, 40, 19, 86, 27, 90]
            }
          ]
        }
      };


    return (
        <div>
            <div className="App">
                <LineChart 
                    width={850}
                    height={630}
                    data={data}
                />
            </div>				
        </div>
    );
}

export default ChartLine
